import React from 'react';
import '../App.css';
import { Link } from 'react-router-dom';

function Nav() {
    return (
        <nav>
            <h3>Logo</h3>
            <ul className="nav-links">
                <Link to="/"><li>Home</li> </Link>
                <Link to="/about"><li>01. About</li> </Link>
                <Link><li>02. Experience</li></Link>
                <Link><li>03. Work</li></Link>
                <Link><li>04. Contact</li></Link>
                <Link><li>Resume</li></Link>
            </ul>
        </nav>
    )
}

export default Nav;
